import React from "react";

export default function VideoCard(props){
    return(
        <div id="video-card">
            <div id="video-img-section">
                <a href=""><img id="video-img" src={`../${props.item.thumbnail}`} alt="" /></a>
            </div>
        <h1>{props.item.title}</h1>
        <h2>{props.item.desc}</h2>
        <a id="video-link" href={props.item.url}><button id="video-button">Click to Watch</button></a>
        </div>
    )
}
